import Styles from '../../assets/styles/Home.module.css';


class Home extends React.Component{

    render() {
      return (
        <div className={Styles["home-content"]}>
            <p>I am Home</p>

            <div className="head-div"></div>
            <div className></div>
            <div></div>

        </div>
      )
    }
}
export default Home;
